import React from "react";
import axios from "axios";
import { useState } from "react";
import styles from "./SignupStudent.module.css";
function SignupStudent(props) {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  const onSubmit = (e) => {
    e.preventDefault();
    axios
      .post(`${process.env.REACT_APP_SERVER_HOST}/user/signup`, {
        username: username,
        password: password,
      })
      .then((res) => {
        console.log(res);
        window.alert("success");
      })
      .catch((err) => {
        console.log(err);
        window.alert("error");
      });
  };
  return (
    <div className={styles.Total}>
      <div className={styles.Title}>
        <div className={styles.VerticalLine}></div>
        <span>학생 회원가입</span>
      </div>
      <hr className={styles.horizontalLine} />
      <div className={styles.Form} action="">
        <div className={styles.FormHalf}>
          <div className={styles.Subtitle}>
            <div className={styles.VerticalLineSmall}></div>
            <span>프로필 사진</span>
          </div>
          <img
            className={styles.ProfileImg}
            src="https://cdn.pixabay.com/photo/2015/10/05/22/37/blank-profile-picture-973460_1280.png"
            alt=""
          />
        </div>
        <div className={styles.FormHalf}>
          <div className={styles.Subtitle}>
            <div className={styles.VerticalLineSmall}></div>
            <span>아이디</span>
          </div>
          <div className={styles.InputWithValid}>
            <input
              type="text"
              placeholder="아이디를 입력하세요."
              onChange={(e) => setUsername(e.target.value)}
              className={styles.Input}
            />
            <button className={[styles.Button, styles.Input].join(" ")}>
              중복확인
            </button>
          </div>
          <div className={styles.Subtitle}>
            <div className={styles.VerticalLineSmall}></div>
            <span>닉네임</span>
          </div>
          <div className={styles.InputWithValid}>
            <input
              type="text"
              placeholder="닉네임을 입력하세요."
              onChange={(e) => setPassword(e.target.value)}
              className={styles.Input}
            />
            <button className={[styles.Button, styles.Input].join(" ")}>
              중복확인
            </button>
          </div>
          <div className={styles.Subtitle}>
            <div className={styles.VerticalLineSmall}></div>
            <span>비밀번호</span>
          </div>
          <div className={styles.InputWithValid}>
            <input
              type="text"
              placeholder="닉네임을 입력하세요."
              onChange={(e) => setPassword(e.target.value)}
              className={styles.Input}
            />
          </div>
          <div className={styles.Subtitle}>
            <div className={styles.VerticalLineSmall}></div>
            <span>비밀번호 확인</span>
          </div>
          <div className={styles.InputWithValid}>
            <input
              type="text"
              placeholder="닉네임을 입력하세요."
              onChange={(e) => setPassword(e.target.value)}
              className={styles.Input}
            />
          </div>
          <div className={styles.Subtitle}>
            <div className={styles.VerticalLineSmall}></div>
            <span>성별</span>
          </div>
          <div className={styles.InputWithValid}>
            <label>
              <input
                type="radio"
                name="sex"
                value="남자"
                onChange={(e) => setPassword(e.target.value)}
                style={styles.Radio}
              />
              남자
            </label>
            <label>
              <input
                type="radio"
                name="sex"
                value="여자"
                placeholder="닉네임을 입력하세요."
                onChange={(e) => setPassword(e.target.value)}
                style={styles.Radio}
              />
              여자
            </label>
          </div>
          <button onClick={onSubmit}>회원가입</button>
        </div>
      </div>
    </div>
  );
}

export default SignupStudent;
